      v8_crdtp::SerializeField(v8_crdtp::SpanFrom("hostId"), m_hostId, out);
      v8_crdtp::SerializeField(v8_crdtp::SpanFrom("root"), m_root, out);
    out->push_back(v8_crdtp::cbor::EncodeStop());
